import React from "react";
import { useState } from "react";
import { useCallback } from "react";

const Passwordgen = () => {
  const [lenght, setLength] = useState(8);
  const [numberAllowed, setnumberAllowed] = useState(false);
  const [char, setchar] = useState(false);
  const [password, setPassword] = useState("");

  const Passwordgenerator = useCallback(() => {
      let str = "ABCDEFGHIJKLMNOPQRSTVWXYZabcdefghijklmnopqrstuvwxyz"
      if (numberAllowed) {
          str += "123456789"
      }
      if (char) {
          str += "!@#$%^&*(){}[]"
      }
  },[lenght , numberAllowed , char , setLength])

  for (let i = 0; i <= length; i++) {
      let char = Math.floor(Math.random() * str.lenght + 1)
      pass = str.charAt(char)
  }

  setPassword(pass)
//   Passwordgenerator()
  return (
    <>
      <div className="w-full bg-gray-400 mx-auto shadow-md max-w-md rounded-lg px-4 my-8 text-red-700">
        Password Generator
        <div className="outline-none w-full py-1 px-3">
          <input
            type="text"
            value={password}
            placeholder="password"
            readOnly
          ></input>
          <button className="px-3 outline-none text-white">Copy</button>
        </div>
        <div className="flex text-sm gap-x-2">
          <div className="flex items-center gap-x-1">
            <input
              type="range"
              min={8}
              max={100}
              value={lenght}
              onChange={(e) => setLength(e.target.value)}
            ></input>
            <label>Length: {lenght}</label>
          </div>
          <div className="flex items-center gap-x-1">
            <input
              type="checkbox"
              defaultChecked={numberAllowed}
              id="numberinput"
              onChange={() => setnumberAllowed((prev) => !prev)}
            ></input>
            <label>Numbers</label>
          </div>
          <div className="flex items-center gap-x-1">
            <input
              type="checkbox"
              defaultChecked={char}
              id="charInput"
              onChange={() => setchar((prev) => !prev)}
            ></input>
            <label>chracter</label>
          </div>
        </div>
      </div>
    </>
  );
};

export default Passwordgen;
